import React, { useState } from "react";
import {
	AiFillRightCircle,
	AiOutlineMinus,
	AiOutlinePlus,
} from "react-icons/ai";
import questions from "./data";
const Question = () => {
	return (
		<>
			{questions.map((question) => {
				const { id, title, info } = question;
				return <article key={id} className="question"></article>;
			})}
		</>
	);
};
export default Question;
